import React from 'react'
var tf = require('@tensorflow/tfjs')

let model = null
const init = async () => {
	try{
		model = await tf.loadLayersModel('http://localhost:3000/modelJS/model.json')
		console.log(model)
	}
	catch(e){
		console.log(e)
	}
}

init()
const Main = () => {

	if (model == null)
		console.log('model loaded')
	return null
}

export default Main;
